li behar du callback_url-ak','Valle'=>'Arana','Add new order'=>'Eskaera berria gehitu','Save changes'=>'Aldaketak gorde','Page settingCart'=>'Saskia','Page settingCheckout'=>'Erosketa burutu','Invalid coupon code'=>'Kupoi kode baliogabea','Missing parameter %s'=>'%s parametroak faltan','The coupon code already exists'=>'Kupoi kodea dagoeneko existitzen da','Placeholder'=>'Posizio marka','Deleted %s'=>'Ezabatu %s','Author URL'=>'Egilearen URLa','Version'=>'Bertsioa','Backorders?'=>'Erreserbak?','Displays whether or not the current active theme declares WooCommerce support.'=>'Uneko itxura aktiboak WooCommerce bateragarritasuna adierazten duen edo ez bistaratzen du.','The parent theme developers URL.'=>'Itxura gurasoaren garatzaileen URLa.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Web zerbitzu batzuk, bidalketa zerbitzuak kasu, SOAP erabiltzen dute urruneko zerbitzarietatik informazioa eskuratzeko. FedEx-en zuzeneko bidalketa aurrekontuek SOAP instalatuta egotea behar dute, adibidez.','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'GZip (gzopen) MaxMind-eko GEOIP datubasea irekitzeko erabiltzen da.','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Katalogoan zein dibisa prezio zerrendatzen diren eta ordainketak zein dibisa atebidek hartuko dituen.','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'Eskari/produktu egoerei lotuta erabili daitezkeen taxonomia terminoen zerrenda.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'WooCommerce zuk eraiki ez duzun guraso itxura batean aldatzen ari bazara, itxura ume bat erabiltzea gomendatzen dizugu. Ikusi: <a href="%s" target="_blank">Itxura ume bat nola sortu</a>','This section shows any files that are overriding the default WooCommerce template pages.'=>'Atal honek WooCommerce-ko lehenetsitako txantiloi orrialdeak gainidazten dituzten fitxategiak erakusten ditu.','Overrides'=>'Gainidazketak','Change to:'=>'Honetara aldatu:','Several WooCommerce extensions can write logs which makes debugging problems easier. The directory must be writable for this to happen.'=>'Zenbait WooCommerce luzapenek arazoak araztea errazten duten logak idatzi ditzakete. Direktorioan idazketa baimenak behar dira horretarako.','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin PHP instalazioetarako babespen sistema aurreratu bat da. Zure zerbitzariak alde batetik PHP aplikazioetan ezagunak diren zenbait arazoren aurka eta bestetik aplikazio hauetan eta PHP nukleoan bertan egon daitezkeen ahultasun ezezagunen aurka babesteko diseinatu zen. Zure zerbitzarian aktibatuta badago, Suhosin datu bidalketa limiteak inkrementatzeko konfiguratu behar izatea gerta daiteke. ','Enter sale price (%s)'=>'Merkealdi prezioa sartu (%s)','<strong>Welcome to WooCommerce</strong> &#8211; You&lsquo;re almost ready to start selling :)'=>'<strong>Ongietorri WooCommerce-era</strong> &#8211; laister saltzen hasteko prest egongo zara :)','WooCommerce plugins may use this method of communication when checking for plugin updates.'=>'WooCommerce pluginek komunikazio metodo hau erabili dezakete plugin eguneraketak dauden konprobatzerakoan.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'HTML/Multipart posta elektronikoek DOMDocument erabiltzen dute txantiloietako lerro-tarteko CSS sortzeko.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'Zure zerbitzariak %s klasea gaitu gabe dauka - HTML/Multipart posta elektronikoak eta beste luzapen batzuk ez dute DOMDocument gabe funtzionatuko.','Visit plugin homepage'=>'Pluginaren webgunea bisitatu','Network enabled'=>'Sarea gaituta','Force SSL'=>'SSL Derrigortu','Does your site force a SSL Certificate for transactions?'=>'Zure webguneak transakzioak egiteko SSL ziurtagiri bat derrigortzen du?','The position of the currency symbol.'=>'Dibisa sinboloaren posizioa.','The thousand separator of displayed prices.'=>'Bistaratzen diren prezioen milakoen bereizlea.','The decimal separator of displayed prices.'=>'Bistaratzen diren prezioen dezimalen bereizlea.','The number of decimal points shown in displayed prices.'=>'Bistaratzen diren prezioetan azalduko den dezimal kopurua.','API Version'=>'APIaren bertsioa','Page not set'=>'Orrialdea ez da zehaztu','Theme'=>'Itxura','The name of the current active theme.'=>'Une honetan aktibo dagoen itxuraren izena.','The installed version of the current active theme.'=>'Une honetan aktibo dagoen itxuraren bertsioa.','%s is available'=>'%s eskuragarri dago','The theme developers URL.'=>'Itxuraren garatzaileen URLa.','Displays whether or not the current theme is a child theme.'=>'Uneko itxura itxura umea den ala ez bistaratzen du.','The name of the parent theme.'=>'Itxura gurasoaren izena.','The installed version of the parent theme.'=>'Instalatutako itxura gurasoaren bertsioa.','Templates'=>'Txantiloiak','Tools'=>'Tresnak','Logs'=>'Logak','— No Change —'=>'— Aldaketarik ez —','Enter price (%s)'=>'Prezioa sartu (%s)','Sale'=>'Beherapena','L/W/H'=>'S/Z/A','Length (%s)'=>'Sakonera (%s)','Width (%s)'=>'Zabalera (%s)','Height (%s)'=>'Altuera (%s)','Visibility'=>'Ikuspena','Catalog &amp; search'=>'Katalogoa eta bilaketa','In stock?'=>'Eskuragarri?','Run the Setup Wizard'=>'Instalatze morroia abiarazi','Custom:'=