your server.'=>'Zure zerbitzariko lehenetsitako ordu-zona.','Default timezone is %s - it should be UTC'=>'Lehenetsitako ordu zona %s da - UTC izan beharko luke','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Ordainketa atebideek cURL erabili dezakete ordainketak autorizatzen dituzten urruneko zerbitzariekin komunikatzeko. Beste plugin batzuek urruneko zerbitzuekin komunikatzeko erabili dezakete.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Zure zerbitzariak ez du fsockopen edo cURL gaituta - PayPal IPN eta beste zerbitzariekin komunikatzen diren script-ak ez dute funtzionatuko. Zure ostatu-emate hornitzailearekin harremanetan jarri.','PayPal uses this method of communicating when sending back transaction information.'=>'PayPal komunikazio hau erabiltzen du transakzioari buruzko informazioa itzultzerakoan.','Error: %s'=>'Errorea: %s','Database'=>'Datubasea','Table does not exist'=>'Taula ez da existitzen','WooCommerce API. Use a consumer key in the username field and a consumer secret in the password field.'=>'WooCommerce APIa. Erabiltzaile izen eremuan kontsumitzaile gako bat erabili eta pasahitz eremuan kontsumitzaile sekretu bat','Consumer secret is invalid.'=>'Consumer Secret-a ez da zuzena','Learn more about templates'=>'Txantiloiei buruz gehiago ikasi','Skip setup'=>'Instalazioa saltatu','Sold individually?'=>'Banaka saltzen da?','Decrease existing price by (fixed amount or %):'=>'Prezio arrunta beheratu (kantitate finkoa edo %):','Not declared'=>'Ez du adierazten','WooCommerce support'=>'WooCommerce laguntza','Child theme'=>'Itxura umea','Page settingMy account'=>'Nire kontua','Page settingShop base'=>'Dendaren oinarria','Remote get'=>'Urruneko get','Remote post'=>'Remote Post','Default timezone is UTC'=>'Lehenetsitako ordu-zona UTC da','SUHOSIN installed'=>'SUHOSIN instalatuta dago','PHP max input vars'=>'PHP sarrera parametroen muga','PHP time limit'=>'PHP denbora muga','PHP post max size'=>'PHP post tamaina maximoa','Server environment'=>'Zerbitzariaren ingurunea','Log directory writable'=>'Log direktorioa idazgarri','WordPress environment'=>'WordPress ingurunea','Copy for support'=>'Euskarrirako kopia','Understanding the status report'=>'Egoera txostena ulertzen','Server info.'=>'Zerbitzariaren Informazioa','PHP version.'=>'PHP bertsioa.','File does not exist'=>'Fitxategia ez da existitzen','Active plugins.'=>'Plugin aktiboak.','MySQL version.'=>'MySQL bertsioa.','Max upload size.'=>'Igoera tamaina maximoa.','WC database version.'=>'WC datubase bertsioa.','Page does not contain the %s shortcode.'=>'Orrialdeak ez du %s laburkodea.','Parent theme name.'=>'Guraso itxuraren izena.','Parent theme author URL.'=>'Guraso itxuraren egilearen URLa.','Parent theme version.'=>'Guraso itxuraren bertsioa.','Pay'=>'Ordaindu','Specific Countries'=>'Herrialde espezifikoak','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Hau probak egiteko demo denda da  &mdash; ez litzateke eskaririk bete beharko.','Free'=>'Doan','This controls the position of the currency symbol.'=>'Honek dibisa sinboloaren kokapena kontrolatzen du.','This option lets you limit which countries you are willing to sell to.'=>'Aukera honek zein herrialdetara saldu nahi duzun mugatzen uzten dizu.','X-Accel-Redirect/X-Sendfile'=>'X-Accel-Redirect/X-Sendfile','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'Aukera hau gaitu jaitsietara atzipena eskariak "prozesatzen" ari direnean emateko, "osatuta" daudenean eman ordez.','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'2 digituko herrialde kode bat, adib. US. Hutsik utzi guztiei aplikatzeko.','Shipping tax class based on cart items'=>'Bidalketa zerga klasea saskiko artikuluetan oinarritu','Round tax at subtotal level, instead of rounding per line'=>'Zerga batura partzial mailan biribildu, lerroz-lerro biribildu ordez.','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Zure produktuen prezioaren ondoren erakutsiko den testua definitu. Zure prezioa azaltzeko mezu bat izan daiteke, "zerga barne", adibidez. Prezioak ordezkatzeko aukera ere baduzu hautako bat erabiliz: {prezioa_zerga_barne}, {prezioa_zerga_gabe}.','Please copy and paste this information in your ticket when contacting support:'=>'Euskarriarekin harremanetan jartzean informazio hau zure txartelan kopiatu eta itsatsi:','This sets the thousand separator of displayed prices.'=>'Honek erakusten diren prezioen milakoen bereizlea ezartzen du.','This sets the number of decimal points shown in displayed prices.'=>'Honek erakusten diren prezioetan azalduko den hamartar kopurua ezartzen du.','This sets the base page of your shop - this is where your product archive will be.'=>'Honek zure dendaren oinarri orrialdea ezartzen du - zure produktu artxiboa bertan egongo da.','Default sorting (custom ordering + name)'=>'Lehenetsitako ordena (orden pertsonalizatua + izena)','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'Oinarri orrialdea zure <a href="%s">produktu esteka iraunkorretan</a> ere erabili daiteke.','Enter a name for this tax rate.'=>'Zerga-tasa honentzako izen bat sartu.','Enter a tax rate (percentage) to 4 decimal places.'=>'4 hamartarreko zehaztasuna duen zerga-tasa (ehuneko) bat sartu.','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'Erregela honentzako hiriak. Punto-koma erabili (;) balio anitz bereizteko. Hutsik utzi hiri guztiei aplikatzeko.','Compound'=>'Konposatua','Choose whether or not this tax rate also gets applied to shipping.'=>'Zerga tasa hau bidalketari aplikatzen zaion aukeratu.','Friendly name for identifying this webhook, defaults to Webhook created on %s.'=>'Webhook hau identifikatzeko izen esanguratsua, izen lehenetsia &quot;%s-n sortutako webhook&quot; da.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Aukerak &quot;Aktibo&quot; (datuak entregatzen ditu), &quot;Etenda&quot; (ez du ezer entregatzen) edo &quot;Desgaituta&quot; (erroreen ondorioz ez du ezer entregatzen) dira.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'2 karaktereko estatu kodea, AL, adib. Hutsik utzi guztietan aplikatzeko.','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Zerga tasa honentzako lehentasun bat aukeratu. Lehentasun bakoitzeko, bat datorren tasa bat bakarrik erabiliko da. Eremu bakar batentzat hainbat zerga tasa definitzeko tasa bakoitzeko lehentasun desberdin bat zehaztu behar duzu.','This option determines which address is used to calculate tax.'=>'Aukera honek zergak kalkulatzeko zein helbide erabiltzen den determinatzen du.','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Aukeran bidalketak zein zerga klase duen kontrolatu, edo bidalketa zergak saskian dauden artikuluetan oinarritzea utzi.','As a single total'=>'Guztizko bakar bat','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Aukera hau garrantzitsua da, prezio-sartzean eragina baitu. Aukera aldatzeak ez ditu dagoeneko dituzun produktuak eguneratuko.','The following options affect how prices are displayed on the frontend.'=>'Aukera hauek webguneko prezioen bistaratze moduan eragiten dute.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Honek katalogoan zein dibisa prezio zerrendatzen diren eta ordainketak zein dibisa atebidetan egin daitezkeen kontrolatzen du.','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'Hainbat kupoi aplikatzerakoan, lehenengo kupoia prezio osoari aplikatu, bigarrena beheratutako prezioari aplikatu, etab.','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Orrialde hauek WooCommerce-ek erabiltzaileak erosketa burutzeko nora bidali jakin dezan zehaztu behar dira.','Popularity (sales)'=>'Salmenten arabera','Sort by most recent'=>'Berrienak lehenengo','Sort by price (asc)'=>'Prezioaren arabera (goranzkoa)','Sort by price (desc)'=>'Prezioaren arabera (beheranzkoa)','Add to cart behaviour'=>'Saskira gehitu portaera','Redirect to the cart page after successful addition'=>'Ondo gehitu ondoren erosketa saskira berbideratu','Enable AJAX add to cart buttons on archives'=>'Artxiboetan AJAX saskira gehitu botoiak gaitu','Enable stock management'=>'Stock kudeaketa gaitu','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'Stocka (ordaindu gabeko eskarientzat) mantendu x minutuz. Muga hau iristean, zain dagoen eskaria ezeztatu egingo da. Hutsik utzi desgaitzeko.','Notifications'=>'Jakinarazpenak','Enable low stock notifications'=>'Stock gutxiko jakinarazpenak gaitu','Enable out of stock notifications'=>'Stock agortze jakinarazpenak gaitu','Hide out of stock items from the catalog'=>'Stock gabeko artikuluak katalogoan ez azaldu','Redirect only'=>'Berbideraketa bakarrik','Downloads require login'=>'Jaitsierek saioa hastea eskatzen dute','This setting does not apply to guest purchases.'=>'Aukera hau ez zaie bisitariek egindako erosketei aplikatzen.','Grant access to downloadable products a